const http = fetch("http://localhost:5000/register", {
  method: "POST",
  crossDomain: true,
  headers: {
    "Content-Type": "application/json",
    Accept: "application/json",
    "Access-Control-Allow-Origin": "*",
  },
  body: JSON.stringify({
    fname,
    email,
    lname,
    password,
  }),
})
  .then((res) => res.json())
  .then((data) => {
    console.log(data, "userRegister");
  });

export default http;
